[{"location":"GraphLaplacian/#GraphLaplacian","page":"GraphLaplacian","title":"GraphLaplacian","text":"","category":"section"},{"location":"GraphLaplacian/","page":"GraphLaplacian","title":"GraphLaplacian","text":"Modules = [ManifoldInterpolation]\nPages   = [\"graphLaplacianToolbox.jl\"]","category":"page"},{"location":"GraphLaplacian/#ManifoldInterpolation.CustomGraph","page":"GraphLaplacian","title":"ManifoldInterpolation.CustomGraph","text":"CustomGraph\n\nThis custom datatype allows to save a mesh and the corresponding graph, as well as Metadata of the mesh. The default constructor takes a string to the location of the mesh in a VTK format.\n\n\n\n\n\n","category":"type"},{"location":"GraphLaplacian/#ManifoldInterpolation.computeEigenGraph-Tuple{CustomGraph, Int64}","page":"GraphLaplacian","title":"ManifoldInterpolation.computeEigenGraph","text":"computeEigenGraph(graph::CustomGraph,N::Int )\n\nThis function computes the smallest N eigenvalues and eigenfunctions.\n\n\n\n\n\n","category":"method"},{"location":"GraphLaplacian/#ManifoldInterpolation.computeEigenGraph-Tuple{CustomGraph}","page":"GraphLaplacian","title":"ManifoldInterpolation.computeEigenGraph","text":"computeEigenGraph(graph::CustomGraph)\n\nThis function computes the smallest N eigenvalues and eigenfunctions.\n\n\n\n\n\n","category":"method"},{"location":"GraphLaplacian/#ManifoldInterpolation.createLaplacian-Tuple{CustomGraph}","page":"GraphLaplacian","title":"ManifoldInterpolation.createLaplacian","text":"createLaplacian(graph::CustomGraph)\n\nThis function creates a graph as well as the corresponding Laplace matrix.\n\n\n\n\n\n","category":"method"},{"location":"GraphLaplacian/#ManifoldInterpolation.distanceEigenfunctions","page":"GraphLaplacian","title":"ManifoldInterpolation.distanceEigenfunctions","text":"distanceEigenfunctions(graph1::CustomGraph, graph2::CustomGraph, n::Number=50)\n\nThis functions distance between two graphs in 3 norms.\n\n\n\n\n\n","category":"function"},{"location":"GraphLaplacian/#ManifoldInterpolation.loadMesh-Tuple{CustomGraph}","page":"GraphLaplacian","title":"ManifoldInterpolation.loadMesh","text":"loadMesh(graph::CustomGraph)\n\nThis function reads the mesh.\n\n\n\n\n\n","category":"method"},{"location":"GraphLaplacian/#ManifoldInterpolation.saveResults","page":"GraphLaplacian","title":"ManifoldInterpolation.saveResults","text":"saveResults(graph::CustomGraph, outputPath::String=\"result\")\n\nThis function exports the first N smallest eigenvalues as well as the corresponding eigenvectors as a vtu file.\n\n\n\n\n\n","category":"function"},{"location":"GraphLaplacian/#ManifoldInterpolation.transformMesh-Tuple{CustomGraph, Function, Any}","page":"GraphLaplacian","title":"ManifoldInterpolation.transformMesh","text":"transformMesh(graph::CustomGraph, transformationOperator::Function,functionArg)\n\nThis functions applies a transformationOperator to the coordinates of the graph.\n\n\n\n\n\n","category":"method"},{"location":"#ManifoldInterpolation.jl","page":"ManifoldInterpolation.jl","title":"ManifoldInterpolation.jl","text":"","category":"section"},{"location":"","page":"ManifoldInterpolation.jl","title":"ManifoldInterpolation.jl","text":"Documentation for ManifoldInterpolation.jl","category":"page"},{"location":"","page":"ManifoldInterpolation.jl","title":"ManifoldInterpolation.jl","text":"","category":"page"},{"location":"Interpolation/#Interpolation","page":"Interpolation","title":"Interpolation","text":"","category":"section"},{"location":"Interpolation/","page":"Interpolation","title":"Interpolation","text":"Modules = [ManifoldInterpolation]\nPages   = [\"interpolationToolbox.jl\"]","category":"page"},{"location":"Interpolation/#ManifoldInterpolation.CustomInterpolator","page":"Interpolation","title":"ManifoldInterpolation.CustomInterpolator","text":"\n\n\n\n","category":"type"},{"location":"Interpolation/#ManifoldInterpolation.SafeInterpolator","page":"Interpolation","title":"ManifoldInterpolation.SafeInterpolator","text":"SafeInterpolator\n\n\n\n\n\n","category":"type"},{"location":"Interpolation/#Interpolations.interpolate","page":"Interpolation","title":"Interpolations.interpolate","text":"\n\n\n\n","category":"function"},{"location":"Interpolation/#Interpolations.interpolate-Tuple{ManifoldInterpolation.AdaptiveInterpolator, Number}","page":"Interpolation","title":"Interpolations.interpolate","text":"\n\n\n\n","category":"method"},{"location":"Interpolation/#ManifoldInterpolation.exp_log_error-NTuple{4, Any}","page":"Interpolation","title":"ManifoldInterpolation.exp_log_error","text":"exp_log_error(points, parameter_points, origin, Gr )\n\nThis function checks the accuracy of the exp and log maps. This is done by applying first the log map to project a point from the manifold to the tangentspace space. After that this point is retracted back to the manifold. The distance between the new point and the starting point give an indication on how precise the log and exp maps are.\n\n\n\n\n\n","category":"method"},{"location":"Interpolation/#ManifoldInterpolation.initialize-Tuple{ManifoldInterpolation.AdaptiveInterpolator}","page":"Interpolation","title":"ManifoldInterpolation.initialize","text":"\n\n\n\n","category":"method"},{"location":"Interpolation/#ManifoldInterpolation.interpolate_complete-NTuple{5, Any}","page":"Interpolation","title":"ManifoldInterpolation.interpolate_complete","text":"interpolate_complete( itp_sample_points, itp_sample_points_parameter, itp_parameter_points, origin, n_dim)\n\nThis function interpolates between the given sample points. For this it uses the Grassmann manifold and the tangentspace. The sample points correspond to the parameter value where the sample point was sampled. The parameter points are the points where you want new interpolation values. The origin is the point on the Grassmann manifold where the tangentspace is constructed. The number of eigenvectors to interpolate is set by n_dim.\n\n\n\n\n\n","category":"method"},{"location":"Interpolation/#ManifoldInterpolation.interpolate_tangentspace-Tuple{ManifoldInterpolation.AdaptiveInterpolator, Number}","page":"Interpolation","title":"ManifoldInterpolation.interpolate_tangentspace","text":"\n\n\n\n","category":"method"},{"location":"Interpolation/#ManifoldInterpolation.lagrange_basis-Tuple{Any, Any, Any}","page":"Interpolation","title":"ManifoldInterpolation.lagrange_basis","text":"\n\n\n\n","category":"method"},{"location":"Interpolation/#ManifoldInterpolation.plot_crossing-NTuple{8, Any}","page":"Interpolation","title":"ManifoldInterpolation.plot_crossing","text":"plot_crossing(graphs, n_eigenfunctions, n_safety, itp_values, true_values, parameter_points, itp_sample_parameter_point, Gr)\n\nThis function allows to quickly plot eigenvalue crossings.\n\n\n\n\n\n","category":"method"},{"location":"Interpolation/#ManifoldInterpolation.plot_interpolation_error","page":"Interpolation","title":"ManifoldInterpolation.plot_interpolation_error","text":"plot_error_interpolation = scatter(title=title, xlabel=\"Parameter\", ylabel=\"Error\",size=(1000,300) ,margin=5Plots.mm)\n\nThis function allows for a quick plot of the interpolation error.\n\n\n\n\n\n","category":"function"}]
